// StockMovementDashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Button, TextField, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const StockMovementDashboard = () => {
  const [stockMovements, setStockMovements] = useState([]);
  const [newMovement, setNewMovement] = useState({
    product: '',
    type: 'entry',
    quantity: 0,
    location: 'armoire 01',
    operator: '',
    datetime: ''
  });

  useEffect(() => {
    axios.get('http://localhost:8080/api/mvt')
      .then(response => setStockMovements(response.data))
      .catch(err => console.error(err));
  }, []);

  const handleCreateMovement = () => {
    axios.post('http://localhost:8080/api/mvt', newMovement)
      .then(response => {
        setStockMovements([...stockMovements, response.data]);
        setNewMovement({
          product: '',
          type: 'entry',
          quantity: 0,
          location: 'armoire 01',
          operator: '',
          datetime: ''
        });
      })
      .catch(err => console.error(err));
  };

  const handleDeleteMovement = (movementId) => {
    axios.delete(`http://localhost:8080/api/mvt/${movementId}`)
      .then(() => {
        setStockMovements(stockMovements.filter(m => m._id !== movementId));
      })
      .catch(err => console.error(err));
  };

  return (
    <div>
      <h2>Stock Movement Management</h2>

      <TextField
        label="Product ID"
        value={newMovement.product}
        onChange={(e) => setNewMovement({ ...newMovement, product: e.target.value })}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Operator"
        value={newMovement.operator}
        onChange={(e) => setNewMovement({ ...newMovement, operator: e.target.value })}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Quantity"
        type="number"
        value={newMovement.quantity}
        onChange={(e) => setNewMovement({ ...newMovement, quantity: e.target.value })}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Location"
        value={newMovement.location}
        onChange={(e) => setNewMovement({ ...newMovement, location: e.target.value })}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Datetime"
        type="datetime-local"
        value={newMovement.datetime}
        onChange={(e) => setNewMovement({ ...newMovement, datetime: e.target.value })}
        fullWidth
        margin="normal"
      />

      <Button variant="contained" color="primary" onClick={handleCreateMovement}>
        Create Movement
      </Button>

      <h3>Existing Stock Movements</h3>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Product</TableCell>
              <TableCell>Type</TableCell>
              <TableCell>Quantity</TableCell>
              <TableCell>Location</TableCell>
              <TableCell>Operator</TableCell>
              <TableCell>Datetime</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {stockMovements.map((movement) => (
              <TableRow key={movement._id}>
                <TableCell>{movement.product}</TableCell>
                <TableCell>{movement.type}</TableCell>
                <TableCell>{movement.quantity}</TableCell>
                <TableCell>{movement.location}</TableCell>
                <TableCell>{movement.operator}</TableCell>
                <TableCell>{movement.datetime}</TableCell>
                <TableCell>
                  <Button variant="outlined" color="error" onClick={() => handleDeleteMovement(movement._id)}>
                    Delete
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default StockMovementDashboard;
